import React, { Component } from 'react';

import './styles.css';

const sectionStyle = {
	color: "red"
}

export default class Banner extends Component {
	render() {

		return (
			<section className="banner"
			style = { sectionStyle }
			>
				<h1>{this.props.title}</h1>
				<p>{this.props.description}</p>
			</section>
		);
	}

}
